import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Link,
  Route,
  Redirect,
} from 'react-router-dom';
import Header from './components/header';
import Login from './components/login';

const App = () => {
  return (
    <>
    <Header />
    <Router>
      <Switch>
        <Route path={'/login'}>
          <Login />
        </Route>
        <Route path={'*'}>
            404 Error
        </Route>
      </Switch>
    </Router>
    </>
  );
}

export default App;
